import React from 'react';
import Input from './Input'
import Buttons from './Buttons'
import './Panel.css';
import MovesHistory from './MovesHistory';

class Panel extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            moves: ['Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', ]
        }
    }

    render() {
        return (
            <aside id="Panel">
                <Input />
                <h3>Session History</h3>
                <hr />
                <MovesHistory />
                <Buttons />
            </aside>
        );
    }
}

export default Panel;
